// import {useState} from 'react'
import {useNavigate} from 'react-router-dom'
import "./register.css";
import Button from "@material-ui/core/Button";
import style from "../../components/atoms/Button/buttonsStyles";
import Logo from "../../resources/img/logo_gather.png"

const Register = () => {
  let navigate = useNavigate()
  // const defaultUser = useState({
  //     usuario: 'usuarioPrueba1',
  //     clave: '123456'
  // })

  return (
    <>
      <div className="container-register container-fluid d-flex flex-column row">
        <div className="container-content">
        <div className="div-sup col-12 d-flex justify-content-end">
        <Button
          className="button btn-login my-4"
          variant="contained"
          style={style}
          onClick={() => {navigate('/home')}}
        >
          Ir a inicio
        </Button>
        </div>
        <div className="logo-register col-md-6 m">
          <div className="logo">
            <img className="img-fluid" src={Logo} alt="" />
            <h1 className="brand-name text-white">Gather</h1>
          </div>
        </div>
        <div className="button-form col-md-6 justify-content-center bg-dark">
        <Button
          className="button btn-login my-4"
          variant="contained"
          style={style}
        >
          join now
        </Button>
        </div>
        </div>
      </div>
    </>
  );
};

export default Register;
